import React from 'react';
import './App.css';
import Home from './components/Home';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import NormalCar from './components/NormalCar';

function App() {
  const AbstractEngine = [
    {
    id: 1,
    EngineType: "Benzine"
  },
  {
    id: 2,
    EngineType: "Gas"
  }
]
const AbstractCarColor = [
  {
    id: 1,
    color:"wit"
  },
  {
    id: 2,
    color:"zwart"
  },
  {
    id: 2,
    color:"blauw"
  }
]
  const AbstractDoor = [
    {
      id: 1,
      color:"Wit"
    },
    {
      id: 2,
      color:"Zwart"
    },
    {
      id: 2,
      color:"Blauw"
    }
]
  const AbstractWindow = [
    {
    id: 1,
    color:"Transparant"
  },
  {
    id: 2,
    color:"Gedimd"
  }
]
  const AbstractTire = [
    {
    id: 1,
    color:"grijs",
    BrandName: "Michelin",
  },
  {
    id: 2,
    color:"zwart",
    BrandName: "Michelin",
  }
]
  const AbstractRim = [
    {
    id: 1,
    color: "chrome",
  },
  {
    id: 2,
    color: "staal",
  }
]

  return (
    <div className="App">
      <BrowserRouter>
          <Routes>
              <Route path='/' element={<Home/>}/>
                  <Route 
                  path='/normale-auto'
                   element=
                   {
                   <NormalCar
                    engine={AbstractEngine}
                    doors={AbstractDoor}
                    windows={AbstractWindow}
                    tires={AbstractTire}
                    rims={AbstractRim}
                    color={AbstractCarColor}
                   />
                   }/>    
          </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
